import React from "react";
import headerStyles from "./app-header.module.css";
import { Logo, BurgerIcon, ProfileIcon, ListIcon } from "@ya.praktikum/react-developer-burger-ui-components";

const AppHeader = () => {
    return (
        <>
            <header className={headerStyles.header}>
                <div className={headerStyles.header_menu}>
                    <div className={headerStyles.header_con}>
                        <BurgerIcon type="primary" />
                        <a className="text text_type_main_default">Конструктор</a>
                    </div>
                    <div className={headerStyles.header_con}>
                        <ListIcon type="secondary" />
                        <a className="text text_type_main-default text_color_inactive">Лента заказов</a>
                    </div>
                    <Logo />
                    <div className={headerStyles}>

                    </div>
                </div>
            </header>
        </>
    );
}

export default AppHeader;
